  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Sand Lake
  WMD outlines Refuge accomplishments during the 1985 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning,
  compliance with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  manpower programs, volunteer programs, funding, and safety is given. Habitat management
  is also covered; subjects include wetlands, croplands, grasslands, grazing, haying,
  fire management, pest control, water rights, and WPA easements. The wildlife section
  of the report discusses endangered and threatened species, waterfowl, marsh birds
  and waterbirds, shorebirds, game mammals, fisheries resources, wildlife propagation,
  and animal control. The public uses of the Refuge described in this report include
  hunting, fishing, trapping, and wildlife observation. The equipment and facilities
  section of the report provides information about new construction and rehabilitation.
  Items of interest are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
